import React from 'react';

import {
  Container,
  ContentContainer,
  TitleContainer,
  SubTitle,
  ImageContainer,
} from './styles';

import imageIIDS from 'src/assets/projects/iids.jpg';
import imageInfinity from 'src/assets/projects/infinity.jpg';
import imageLife from 'src/assets/projects/life.jpg';
import imageNei from 'src/assets/projects/nei.jpg';

import Thumbnail from 'src/components/thumbnail';

const Project: React.FC = () => {
  return (
    <Container>
      <ContentContainer>
        <TitleContainer>Projects</TitleContainer>
        <SubTitle>
          Here are some of my works, around 10 projects were carried out. I
          separated some of my own projects or carried out in partnership in
          this session.
        </SubTitle>
        <ImageContainer>
          <Thumbnail
            image={imageIIDS}
            title="IIDS"
            description="Instituto Integrado de Desenvolvimento em Saúde"
          ></Thumbnail>

          <Thumbnail
            image={imageInfinity}
            title="Infinity Participações"
            description="sdfiushfd"
          ></Thumbnail>

          <Thumbnail
            image={imageLife}
            title="LIFE"
            description="sdfiushfd"
          ></Thumbnail>
          <Thumbnail
            image={imageNei}
            title="Infinity Participações"
            description="sdfiushfd"
          ></Thumbnail>
          <Thumbnail
            image={imageIIDS}
            title="DSFDSF"
            description="sdfiushfd"
          ></Thumbnail>
        </ImageContainer>
      </ContentContainer>
    </Container>
  );
};

export default Project;
